import React from 'react'
import { useContext } from 'react';
import noteContext from '../contexts/notes/noteContext';

function Notes() {
    let context=useContext(noteContext);
    let {notes,setnotes}=context;
    return (
        <div>
            <h2>Your Notes</h2>
            {notes.map((note) => {
                return note.title;
            })}
        </div>
    )
}

export default Notes
